  14,\n\t\"tags\": [],\n\t\"title\": \"CTD data of the Hawaii Ocean Time-series (HOT)
  program in the North Pacific 100 miles north of Oahu, Hawaii for cruises HOT239-248
  during 2012 (NODC Accession 0119895)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-11-10T02:51:09.554113\",\n\t\"name\": \"ctd-data-of-the-hawaii-ocean-time-series-hot-program-in-the-north-pacific-100-miles-north-of-oaf73a6\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOT program makes repeated observations
  of the physics, biology and chemistry at a site approximately 100 km north of Oahu,
  Hawaii. Two stations are visited about once a month: Kahe Point (Station 1: 21.34N,
  158.27W) and Station ALOHA (Station 2: 22.75N, 158W). Various other stations are
  made intermittently in support of similar research objectives or mooring deployments.nnHOT
  CTD data are collected using a SeaBird CTD 9-11 Plus with dual sensors at the maximum
  sampling rate of 24 samples per second (24 Hz). They are screened for errors and
  processed to 2-dbar averages. Starting in 2006, the percent transmission field was
  replaced with a nitrate in the dataset.nnThis NODC Accession contains CTD data for
  HOT cruises 239-248 during 2012. Bottle and thermosalinograph data from the same
  cruises are available in separate NODC accessions.\",\n\t\"license_title\": null,\n\t\"extras\":
